\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"13057","type":"CustomJS"},{"attributes":{},"id":"12773","type":"LinearScale"},{"attributes":{"axis":{"id":"12976"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"12979","type":"Grid"},{"attributes":{"axis":{"id":"12779"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"12782","type":"Grid"},{"attributes":{},"id":"12919","type":"LinearScale"},{"attributes":{"data":{"x":[646,4845.937439880122]},"selected":{"id":"12910"},"selection_policy":{"id":"12909"}},"id":"12886","type":"ColumnDataSource"},{"attributes":{"dimensions":"width"},"id":"12929","type":"PanTool"},{"attributes":{"children":[[{"id":"12767"},0,0],[{"id":"12913"},1,0],[{"id":"12727"},2,0],[{"id":"12964"},3,0]]},"id":"13128","type":"GridBox"},{"attributes":{"line_alpha":0.1,"line_color":"red","line_width":2,"x":{"field":"x"},"y":{"value":1.2244196530000002}},"id":"12888","type":"Line"},{"attributes":{"dimensions":"width"},"id":"12783","type":"PanTool"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAA
